import PrivateRoute from './PrivateRoute'; // Import the PrivateRoute component

root.render(
  <React.StrictMode>
    <Provider store={store}>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<MainPreSite />} />
          <PrivateRoute path="App" element={<App />} />
          <PrivateRoute path="patients" element={<Patient />} />
          <PrivateRoute path="appointments" element={<Appointment />} />
        </Routes>
      </BrowserRouter>
    </Provider>
  </React.StrictMode>
);

